Edisi OSKM ITB 2017 part 6.

@feliciashelly_ a.k.a. Siti. Pertama kali kenalan di basecamp tk16, susah banget ngafalin nama orang satu ini, jadi dipanggil Siti aja biar afal. Ternyata ini orang mentor HAHAHA.
.
@edwinwirya a.k.a. Edwin. Salah satu anak fasil 7Khey qu yang attention to detail dan bertanggung jawab. Bobo dimana aja! Ditinggal bentar tiba2 tidur. Untung bener jadi PJ spek obat medik.
.
@denabilly a.k.a. Billy. Orang ini keliatannya baik. Buktinya ia rela ngejemput Edwin yang tertidur pulas malem2.
.
Last but.. Emang last aja sih, Harun. Orang ini keliatan kasian dimanapun, kapanpun, dan kondisi apapun. :((

Edisi OSKM ITB 2017 part 5.

@dianavitonia a.k.a. Little Agatha. One of my superteam pengganti @agathaa_victoria. Meneruskan kerjaan ncinya pula sebagai kadiv acaraqu. Hubungan kakak adik ini tidak berlangsung bahagia. Sekali2 akur lah, jangan lupa beliin makanan.
.
@raihansirhindi a.k.a. Raihan. Ngomong ceplas ceplos no filter, gpp asal jujur dari hati. Niat pengen mengakuisisi BPA supaya BPA saat ini menghafal fungsi BPA itu sendiri. Tiap kali berdinas medik liat dia gabut, padahal emang gabut.
.
@ajiprtma a.k.a. Aji. Pertama kali ketemu di motday ngomongnya mau masuk tekkim. Orangnya slengean ternyata divisi keamanan. Basecamp sebelahan sama kosan tapi jarang dateng juga. Suka salim padahal umur ga jauh beda.
.
@gabnath1 a.k.a. Gaby. Tiba2 ada yang ngechat nanyain textbook tekkim semester 3. Wah pasti ambis banget nih orang. Terlihat jelas dari kantong matanya (Apalagi pas tes kenal jam 12 maleman, kantong mata uda kek kantong kresek)

Edisi OSKM ITB 2017 part 4.

@jessicanancyw_ a.k.a Jesum. Anak basis 27, first impression udah kek orang skip dan nohope dengan segala kesibukan yang dia punya. Sekarang UBT LFM disabet, medik pula, trus jadi koorlap kader UBT.
.
@baspradipta a.k.a. Basil. Masuk ekstrakampus biar bekerja ekstra di kampus. Si penghancur flow pelantikan susulan TK16 dengan berorasi: "Buah apa yang kulitnya kuning trus isinya pisang? Pisang".
.
@ivantivant a.k.a Vante. Si superdanyel Proserus Abisatya yang sangat openminded dan terbuka segala keluh kesahnya. Saat jam 1 subuh sedang rapat aksi angkatan 16: "Sebenernya vante bisa ngedesain, cuma vante lagi ga mampu."
.
@kafiadi a.k.a. Kafi. Salah satu yg lantik telat karena mengemban tugas nan berat sebagai dansus. Dateng2 ke basecamp jam 2 subuh, dikira mau rapat aksi angkatan ternyata langsung tidur.

